import React, { useEffect, useState } from "react";
import { ICars } from "../../types/types";
import "./index.css";
import { Link, useNavigate } from "react-router-dom";

type ListProps = {
  data: ICars[];
};

export default function List({ data }: ListProps) {
  const navigation = useNavigate()

  return (
    <div className="container-list">
      {data.map((car) => (
        <div key={car.Model_ID} className="car-block">
          <div className="car-image">
            <img src={`${process.env.PUBLIC_URL}/assets/${car.Model_ID}.jpg`} width="270" height="200" alt="car"></img>
          </div>
          <p>Title: {car.Make_Name}</p>
          <p>Model: {car.Model_Name}</p>
          <p>Year: {car.year}</p>
          <p>price: {car.price}</p>
          <p onClick={() => navigation.navigate()}>more info</p>
{/*           <Link to={`/${car.Model_ID}`} state={{car: car}}>more info</Link> */}
        </div>
      ))}
    </div>
  );
}
